ot; som finder sted hvert år.\\nEn af byens ældre vælger ud fra opvækst og opførsel et individ som skal allokeres som betyder man skal ud på en rejse med en af de voksne mentorer.\\n\\nDette år blev Amie valgt og skulle have [[Osty]] som mentor.\\nDe tog op mod bjergene og årene gik.\\n\\nAmie fik sit første sjæle-bånd, til et flyveegern som fik navnet [[Oliver]] \\nOliver blev brugt til at holde kontakten til Amielogseq____&apos;s forældre imens hun blev allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Flogseq____&quot;,871,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Xlogseq____&quot;,189,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Vlogseq____&quot;,189,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Ulogseq____&quot;,189,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Ulogseq____&quot;,190,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^Ulogseq____&quot;,335,536870968]],[logseq____&quot;^15logseq____&quot;,[870,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;~:headinglogseq____&quot;,3],536870968]],[logseq____&quot;^15logseq____&quot;,[8 , klatrede i træer og gemte sig. Han brugte meget tid på at snige sig ind på dyr, trænede sine evner til at bevæge sig stille og uset alle steder, men specielt i skoven.\\n\\nEfterhånden som han blev ældre fandt han ud af at han kunne tjene penge ved at holde øje med mennesker og hvad de lavede og hvis de havde hemmelige møder i skoven.\\nPengene tjente han ved at få opgaver om at skaffe information af en fra det lokale marked.\\nEfter at have overvåget en del karavaner og set vagter beskytte dem besluttede han at han også kunne klare det job, og at det ville give ham en chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871005]],[logseq____&quot;^15logseq____&quot;,[1119,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871005]],[logseq____&quot;^15logseq____&quot;,[1119,logseq____&quot;^Flogseq____&quot;,1122,536871005]],[logseq____&quot;^15logseq____&quot;,[1119,logseq____&quot;^Xlogseq____&quot;,33,536871005]],[logseq____&quot;^15logseq____&quot;,[1119,logseq____&quot;^Vlogseq____&quot;,33,536871005]],[logseq____&quot;^15logseq____&quot;,[1119,logseq____&quot;^Ulogseq____&quot;,33,536871005]],[logseq____&quot  <script type="text/javascript">// Single Page Apps for GitHub Pages
      // https://github.com/rafgraph/spa-github-pages

      // ----------------------------------------------------------------------
      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
